import React, {Component} from "react";
import BookCard from "./BookCard";
import Slider from "react-slick";
import "../carousel/slick.css"; 
import "../carousel/slick-theme.css";
import "./bookCardsList.css";

export default function BookCardsList(db) {
    const BookElements = db.bookElements.map(book => {
       return <BookCard key={book.books_id} bookItem={book} />
    })

    const settings = {
            dots: false,
            arrows:true,
            infinite: true,
            slidesToShow: 4,
            slidesToScroll: 4,       
          };

    addElemnetsToDb = db => {
        db.push({
            "id":3,
            "username": "botakoz",
            "firstName": "Botakoz",
            "lastName": "Dauytzhanova",
            "email": "botish.d@gmail.com",
            "password": "qwerty123"
        });
        console.log(db);
    }
    return (
        <div className="book-elements">
                    {this.addElemnetsToDb(db)}
            <Slider {...settings}>
                {BookElements}
            </Slider>    
        </div>
    );

}
